package datatypes;

public class DTContrasenia {

	int ci;
	String contrasenia;
	
	public DTContrasenia() {
		// TODO Auto-generated constructor stub
	}

	public DTContrasenia(int ci, String contrasenia) {
		super();
		this.ci = ci;
		this.contrasenia = contrasenia;
	}

	public int getCi() {
		return ci;
	}

	public void setCi(int ci) {
		this.ci = ci;
	}

	public String getContrasenia() {
		return contrasenia;
	}

	public void setContrasenia(String contrasenia) {
		this.contrasenia = contrasenia;
	}

}
